package org.demo.web;

import org.springframework.web.bind.annotation.RequestMapping;

import java.io.FileOutputStream;
import java.io.FileNotFoundException;
import java.util.Base64;
import java.io.IOException;

/**
 * @author fernandoarevalo
 *
 */

@org.springframework.web.bind.annotation.RestController
public class RestController {
	@RequestMapping("/api/hello")
	public String greet() {
		String encodedImg = "";
		String partSeparator = ",";
		String base64 ="data:image/jpeg;base64,";
		String path = "/Users/fernandoarevalo/Documents/pruebas-img/decoder.jpg";
		if(base64.contains(partSeparator)){
			encodedImg = base64.split(partSeparator)[1];
		}
		
		this.decoder(encodedImg, path);
		return "Hello from other side!!!";
	}
	
	public void decoder(String base64Image, String pathFile) {
		try (FileOutputStream imageOutFile = new FileOutputStream(pathFile)) {
			// Converting a Base64 String into Image byte array
			byte[] imageByteArray = Base64.getDecoder().decode(base64Image);
			imageOutFile.write(imageByteArray);
		} catch (FileNotFoundException e) {
			System.out.println("Image not found" + e);
		} catch (IOException ioe) {
			System.out.println("Exception while reading the Image " + ioe);
		}
	}
}
